import React from 'react';

const NewUsers = (props) => {
    if (props.users.lenght === 0) {
        props.setUsers([
            {
                id: 2,
                fullName: "Armen",
                imageUrl: '#',
                status: "I am boss",
                location: { country: "Russia", city: "Izhevsk" },
                followed: false
            },
            {
                id: 2,
                fullName: "Armen",
                imageUrl: '#',
                status: "I am boss",
                location: { country: "Russia", city: "Izhevsk" },
                followed: false
            }
        ])
    }
    console.log(props.users);
    debugger;

    return (
        <div>
            {
                props.users.map(user => <div key={user.id}> <img src='#' alt='#' />
                    <div>{user.fullName}</div>
                    <div> {user.followed ? <button onClick={() => { props.unfollow(user.id) }}>Unfolow</button> : <button onClick={() => { props.follow(user.id) }}>Follow</button>}</div>
                </div>)
            }
        </div>
    );
};
export default NewUsers;
